import React from 'react';
import UpdateRestaurant from '../components/UpdateRestaurant';

const UpdatePage = () => {
    return (
        <div>
            <h1 className="font-weight-light display-1 text-center">
                Update Restaurant
            </h1>
            <UpdateRestaurant />
        </div>
    )
}

export default UpdatePage;
